import React, { useState } from 'react';
import {Input, Button, message } from 'antd'
import { AiOutlineUserAdd } from "react-icons/ai";
import { BsPeopleCircle } from "react-icons/bs";
import { GiSmartphone ,GiModernCity } from "react-icons/gi";
import { HiOutlineMail, HiOutlineLocationMarker } from "react-icons/hi";
import { RiLock2Line } from "react-icons/ri";
import { FiEye } from "react-icons/fi";


function SignUp(props) {
    let [username, setUsername] = useState("")
    let [password, setPassword] = useState("")
    let [confirmPassword, setConfirmPassword] = useState("")
    let [viewPassword, setViewPassword] = useState(false)
    let [name, setName] = useState("")
    let [email, setEmail] = useState("")
    let [phone, setPhone] = useState("")
    let [address, setAddress] = useState("")
    let [zipCode, setzipCode] = useState("")

    const handleViewPassword = () => {
        setViewPassword(!viewPassword)
    }

    const handleSingup = () => {
        const newUser = {
            username: username,
            password: password,
            name: name,
            email: email,
            phone: phone,
            address: address,
            post_code: zipCode
        }

        fetch('http://localhost:3000/signup', {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify(newUser)
        })
        .then(res => res.json())
        .then(user => {
            localStorage.token = user.token


            if(localStorage.token !== "undefined"){
                alert("Successfuly created a Account")
                props.history.push('/')
            }else {
                alert("Please Try Again")
            }
        })
    }

    return (
      <div className="singup">
        <div className="signup-form">
            <h1>Create your account here</h1>
        <Input 
        addonBefore="Username: "
        prefix={<AiOutlineUserAdd style={{marginRight: "5px"}}/>}
        value={username} 
        laceholder="Please enter your username" 
        onChange={(e) => setUsername(e.target.value)}
        >

        </Input>
        <Input 
        addonBefore="Password: "
        value={password}
        prefix={<RiLock2Line style={{marginRight: "5px"}}/>} 
        placeholder="Please enter your password" 
        onChange={(e) => setPassword(e.target.value)} 
        type={viewPassword? "text" :"password"}
        >

        </Input>
        <FiEye className="rest-view-password" onClick={() => handleViewPassword()} style={{marginLeft: '510px', marginTop: '-50px'}}/>
        <Input 
        addonBefore="Confirm Password: "
        value={confirmPassword}
        prefix={<RiLock2Line style={{marginRight: "5px"}}/>} 
        placeholder="Please enter your password" 
        onChange={(e) => setConfirmPassword(e.target.value)} 
        type={viewPassword? "text" :"password"}
        >

        </Input>
        <FiEye className="rest-view-password" onClick={() => handleViewPassword()}/>
        <Input 
        addonBefore="Full Name: "
        type="text" value={name} 
        prefix={<BsPeopleCircle style={{marginRight: "5px"}}/>} 
        placeholder="Please enter your full name" 
        onChange={(e) => setName(e.target.value)}
        >

        </Input>
        <Input 
        addonBefore="Email: "
        type="text" 
        prefix={<HiOutlineMail style={{marginRight: "5px"}}/>} 
        value={email} 
        placeholder="Please enter your email" 
        onChange={(e) => setEmail(e.target.value)} 
        >

        </Input>
        <Input 
        addonBefore="Phone: "
        type="text"
        prefix={<GiSmartphone style={{marginRight: "5px"}}/>}  
        value={phone} 
        placeholder="Please enter your phone" 
        onChange={(e) => setPhone(e.target.value)}
        >

        </Input>
        <Input 
        addonBefore="Address: "
        type="text" value={address} 
        prefix={<HiOutlineLocationMarker style={{marginRight: "5px"}}/>}  
        placeholder="Please enter your address" 
        onChange={(e) => setAddress(e.target.value)}
        >

        </Input>
        <Input 
        addonBefore="Zip Code: "
        type="text"
        prefix={<GiModernCity style={{marginRight: "5px"}}/>}   
        value={zipCode} 
        placeholder="Please enter your zip code" 
        onChange={(e) => setzipCode(e.target.value)}
        >
        </Input>
        <Button type='primary' onClick={() => handleSingup()} >SignUp</Button>
        </div>      
      </div>

    );
  }

  export default SignUp;
